import React from 'react';
import axios from 'axios';
import './App.css';

class App extends React.Component {
  state = {
    data: []
  }

  componentDidMount() {
    axios.get(`http://localhost:9393/test`)
    .then(res => {
      const data = res.data;
      this.setState({ data});
    })
  }

  render() {
    return (
      <ul>
        { this.state.persons.map(person => <li>{person.name}</li>)}
      </ul>
    )
  }
}

export default App;
